  #getRandomInt(min = 0, max) {
    min = Math.floor(min)
    max = Math.floor(max);
    return Math.floor(Math.random() * (max - min + 1)) + min;
  }

  getRandomValues(value){
    const array = this.#all_data[value] || []
    const rnd = this.#getRandomInt(0,array.length)
    return array[rnd]
  }

